import React from 'react';
import Card from './Card';
import Data from './Data';

function sData(val){
return(
    <Card
        chabi={val.chabi}
        nam={val.nam}
        link={val.link}
    />
);
}

function App(){
    return (
        <>
        <h1>React Component</h1>
        {Data.map(sData)}
        </>
    );
}
export default App;
